import React , { useState } from 'react';

function App(){
  let newTime = new Date().toLocaleTimeString();
  const [ctime , stime] = useState(newTime);

  function GetTime(){
    let updateTime = new Date().toLocaleTimeString();
    stime(updateTime);
  }
  setInterval(GetTime,1000)
  return(
    <>
      <h1>This is {ctime}</h1>
    </>
  )
}

export default App;
